import React, { Component } from 'react'

export default class Userbeaches extends Component {
    render() {
        let userbeachesArr = this.props.userbeaches
        const userBeaches = userbeachesArr.map((userbeach) => {
            return <span key={userbeach.id}>
                <div id="userbeach">
                    <div key={userbeach.id}>
                    {userbeach.name}
                    </div>
                    <button id="delete" onClick={()=>this.props.deleteFromUBs(userbeach)}>Delete from favorites.</button>
                </div>
            </span>


        }
        )
        return (
            <div >Favorite Beaches:
                {userBeaches}
                <div id="userbeach">
                <button onClick={()=>this.props.returnHome(this.props)}>Return to Beachfinder Mainpage</button>
                </div>
            </div>
        )
    }
}
